import {
  mdiAccountCircle,
  mdiDesktopMac,
  mdiShieldAccount,
  mdiSquareEditOutline,
  mdiTable,
  mdiTelevisionGuide
  // mdiResponsive
} from '@mdi/js'

export default [
  'General',
  [
    {
      to: '/dashboard',
      icon: mdiDesktopMac,
      label: 'Dashboard'
    }
  ],
  // 'Examples',
  [
    {
      to: '/pizzas',
      label: "Pizza'ssd",
      icon: mdiTable,
      updateMark: true
    },
    {
      to: '/customers',
      label: "Customer's",
      icon: mdiSquareEditOutline
    },
    {
      to: '/orders',
      label: "Order's",
      icon: mdiTelevisionGuide
    },
    {
      to: '/users',
      label: "User's",
      icon: mdiAccountCircle
    }
  ],
  'About',
  [
    {
      href: '/',
      label: 'Developer Profile',
      icon: mdiShieldAccount
    }
  ]
]
